  return ( 
  <Button className={cn(styles.navButton, selected && styles.navButtonSelected)} {...props}>
    {/* {children} */}
    {notify > 0 && <span className={styles.notify}>{notify}</span>}
  </Button> 
)};

export default NavigationButton
